// append the lock validation info to the message field
import groovy.sql.Sql
import Dq_Utilities.*
def fieldSep =  '~'

com.eviware.soapui.support.GroovyUtils.registerJdbcDriver('oracle.jdbc.driver.OracleDriver')
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def dtaStep = testRunner.testCase.getTestStepByName('getPersonWithLock')
def rspns = dtaStep.getPropertyValue('Response')
def rspnsHldr = groovyUtils.getXmlHolder( rspns)
def rqst = dtaStep.getPropertyValue('Request')
def rqstHldr = groovyUtils.getXmlHolder( rqst)
//def propStep = testRunner.testCase.getTestStepByName('PersonProperties')
def empiVal = testRunner.testCase.testSuite.getPropertyValue('empi')
def lockUser = testRunner.testCase.testSuite.project.getPropertyValue('user')
def lockApp = testRunner.testCase.testSuite.project.getPropertyValue('app1')

def lockIdNode = rspnsHldr.getDomNode('//ns1:lockId')
def lockId
def lockMsg
if( lockIdNode != null) {
	lockId = lockIdNode.getFirstChild().getNodeValue()
	lockMsg = 'Lockid: ' + lockId
} else {
	lockId = ''
	lockMsg = 'No lockid'
}
def wrnMsg = empiVal
if(wrnMsg.length() > 0) wrnMsg = wrnMsg.concat(fieldSep)
wrnMsg = wrnMsg.concat(lockMsg)

// query DB for lock information
ArrayList l = getLockRecords(empiVal)
def matchFlg = true
if(l.size() <= 0) {
	wrnMsg = wrnMsg.concat(fieldSep  + 'No Lock Record')
} else if(l.size() > 1) {
	wrnMsg = wrnMsg.concat(fieldSep  + l.size() + ' Lock Records - ')
	for(int idx = 0; idx < l.size(); idx++) {
		def r = l.get(idx)
		def sqlLock = r.getProerty('LOCK_Id').toString()
		def sqlUser = r.getProperty('LOCK_USER')
		def sqlApp = r.getProperty('APPLICATION')
		def sqlTm = r.getProperty('LOCK_TIME').stringValue()
		wrnMsg = wrnMsg.concat('LOCK_Id:' + quote(sqlLock)) + 
				';LOCK_USER:' + quote(sqlUser)
				';APPLICATION:' + quote(sqlApp)
				';LOCK_TIME:' + quote(sqlTm)
		if(idx < l.size()-1) wrnmsg = wrnMsg.concat(' - ')
	}
} else {
	def r = l.get(0)
	def sqlLock = r.getProperty('LOCK_id').toString()
	if(lockId != sqlLock) {
		wrnMsg = wrnMsg.concat(fieldSep  + 'Expected Lockid ' + quote(lockId) + 
				' Retrieved ' + quote(sqlLock))
		matchFlg = false
	}
	def sqlUser = r.getProperty('LOCK_USER')
	if(lockUser != sqlUser) {
		wrnMsg = wrnMsg.concat(fieldSep  + 'Expected User ' + quote(lockUser) + 
				' Retrieved ' + quote(sqlUser))
		matchFlg = false
	}
	def sqlApp = r.getProperty('APPLICATION')
	if(lockApp != sqlApp) {
		wrnMsg = wrnMsg.concat(fieldSep  + 'Expected App ' + quote(lockApp) + 
				' Retrieved ' + quote(sqlApp))
		matchFlg = false
	}
	if(matchFlg) {
		wrnMsg = wrnMsg.concat(fieldSep  + 'Correct Lock Record (User: ' + quote(sqlUser) + 
				' App: ' + quote(sqlApp) + ')')
	}
}
// add message to property
//propStep.setPropertyValue('message', wrnMsg)
log.info wrnMsg

// exedcute sql query to retrieve lock information
ArrayList getLockRecords(empiVal) {
	def db = testRunner.testCase.testSuite.project.getPropertyValue('TestEnvironment')
	def rtProps = new com.ihc.dq.util.RTProps()
	def userName  = rtProps.getProperty("INITIATE." + db + ".DB.Username")
	def psWrd = rtProps.getProperty("INITIATE." + db + ".DB.Password")
	def dbConnect = rtProps.getProperty("INITIATE." + db + ".DB.Connect")
	def cnctStr = 'jdbc:oracle:thin:' + userName + '/' + psWrd + '@' + dbConnect
	log.info psWrd + ' ' + dbConnect + ' ' + userName
	s = 'SELECT * from EMPI.mmi_lock where mmi_num = ' + quote(empiVal) + 'order by lock_time'
	sql = Sql.newInstance(cnctStr, userName, psWrd)
	l = sql.rows(s)
	sql.close()
	return l
}

String quote(val) {
	return "'" + val + "'"
}

