def p = Runtime.runtime.exec(cmnd)
def ic = p.getInputStream()
def ch = ic.read()
def line = ''
while( ch > 0) {
	if (ch==10) {	// dump line on linefeed
		log.info sMsg + line
		line = ''
	} else {
		if (ch != 13) {	// ignore cr
			line = line + new String(new Integer(ch).byteValue())
		}
	}
	ch = ic.read()
}
//p.waitFor()
def exitVal = p.exitValue()
if (exitVal == 0) {
	log.info sMsg + 'InitiateCompare Ended - ' + exitVal
} else {
	logWarn sMsg + 'InitiateCompare Ended - ' + exitVal
}

