/*
	check response for Fault elements
	if found log them & return True
	else return False
*/
Boolean faultResponse(rspnsHldr){
	def fltStr = rspnsHldr.getDomNode('//faultstring[1]')
	if(fltStr != null) {
		def fltCode = rspnsHldr.getDomNode('//faultcode[1]')
		def prnt = fltStr.getParentNode()
		logError( 'Fault: ' + prnt.getNodeName() + ' -> ' + fltCode.getFirstChild().getNodeValue() + ' - ' + 
				fltStr.getFirstChild().getNodeValue())
		return Boolean.TRUE
	} else {
		return Boolean.FALSE
	} 
}
/*
	check respoosne for warning elements
	If found log them
*/
void logWarnings(rspnsHldr) {
	def wrnMsg = ''
	def wrns = rspnsHldr.getDomNodes('//ns1:Patients[1]/ns1:warnings' )
	if (wrns != null) {
//log.info 'wrns.size() ' + wrns.size()
		for (def idx = 0; idx < wrns.size();idx++) {
			def chn = wrns[idx].getChildNodes()
	//log.info 'chn.getLength() ' + chn.getLength()
			for (def idy = 0; idy<chn.getLength(); idy++) {
				if (chn.item(idy).hasChildNodes()) {
					def cn = chn.item(idy).getChildNodes()
					wrnMsg = cn.item(0).getFirstChild().getNodeValue() + ':' + 
							cn.item(1).getFirstChild().getNodeValue() + ';'
					logWarn idy + '-' + wrnMsg
				}
			}
		}
	}
}

/*
	Log any/all lock information
*/
void logLockInformation(sMsg, l) {
	for( int idx = 0; idx < l.size(); idx++) {
		def dtaMsg = sMsg + idx + '. '
		def row = l.get(idx)
		def keyIt = row.keySet().iterator()
		def dataIt = row.values().iterator();
		while( keyIt.hasNext() & dataIt.hasNext()) {
			data = dataIt.next()
			key = keyIt.next()
			if(data.getClass().getName().endsWith('TIMESTAMP')) {
		    		dtaMsg = dtaMsg + '|' + key + ':' + data.stringValue()
			} else {
		    		dtaMsg = dtaMsg + '|' + key + ':' + data
			}
		}
		log.info dtaMsg 
	}
}

