String getWarnings(wrns) {
	def wrnMsg = ''
	def retVal = ''
	for (def idx = 0; idx < wrns.size(); idx++) {
		def chn = wrns[idx].getChildNodes()
		for (def idy = 0; idy<chn.getLength(); idy++) {
			if (chn.item(idy).hasChildNodes()) {
				def cn = chn.item(idy).getChildNodes()
				for(idz = 0; idz < cn.getLength(); idz++) {
					if (cn.item(idz).getNodeName() == 'Type') { 
						wrnMsg = 'WARNING - '+ cn.item(idz).getFirstChild().getNodeValue()
					} else if (cn.item(idz).getNodeName() == 'Details') {
						wrnMsg = wrnMsg + ':' + cn.item(idz).getFirstChild().getNodeValue()
					}
				}
				wrnMsg = wrnMsg + '\n'
				logWarn idy + '-' + wrnMsg
				retVal += wrnMsg
			}
		}
	}
log.info 'retVal: ' + retVal
	return retVal.replaceAll('\n', '^')
}

