/*
Formulate output DataSink file name from filename template & current search record count
Write the DataSink value names to file as header row
*/
import java.io.BufferedWriter;
import java.io.FileWriter;
import java.io.PrintWriter;
import java.io.File;
import java.io.IOException;

//String sMsg = 'searchStart - '
String sMsg = context.getCurrentStep().getName() + ' - '

// increment search count
Integer srchCnt = new Integer(testRunner.testCase.getPropertyValue('searchCnt' )) + 1
testRunner.testCase.setPropertyValue('searchCnt', srchCnt.toString())
log.info sMsg + 'New srchCnt: ' + srchCnt.toString()

// populate data sink output file name from template and new srchCnt
def outputName = testRunner.testCase.getPropertyValue('outputTmplt' ).concat(srchCnt.toString()).concat('.txt')
def dsStep = testRunner.testCase.getTestStepByName('searchDataSink')
dsStep.dataSink.fileName = outputName
log.info sMsg + 'New Output file: ' + outputName

// Get data sink value names & write header to output file
PrintWriter pw;
File of = new File(dsStep.dataSink.fileName);
def retVal = of.createNewFile()
log.info sMsg + 'File Create: ' + retVal
if (of.length() <= 0) {
	def prpCnt, idx, props
	prpCnt = dsStep.getPropertyCount()
	props = dsStep.getPropertyNames()
	StringBuffer header = new StringBuffer()
	for (idx=0;idx < prpCnt; idx++) {
		header = header.append(props[idx]).append('|')	// pipe separate all field names
	}
	header = header.deleteCharAt(header.length()-1)	// remove terminating pipe
	try {
		pw = new PrintWriter(new BufferedWriter(new FileWriter(of.getPath())));
		pw.println(header);
		log.info header
		pw.close();
		log.info sMsg + 'Output DataSink File Initialized'
	} catch (IOException e) {
// todo Don't fail this, go on to next search?
		testRunner.fail sMsg + 'Error Initializing DataSink File: ' + e.getMessage()
	}
} else {
// todo Don't fail this, go on to next search?
	testRunner.fail sMsg + 'Failed to reset output File' + of.getPath() + ' Length: ' + of.length()
}

