void populateGetPersons(empiList){
/* Since we can't be certain that subsequent uses of the geetPerons request will have access to a
	legitimate structure (only empi deleted, leaving no patientId element) & I haven't been able to
	figure out how to create a patientId element from scratch, we always start with a new request
	structure (getPersonsTmplt)
*/
String CONTEXTXPATH = "//v4:codeSystem//v4:code//v4:value"
String PATIDLISTXPATH = "//v4:getPersons"	// "//v4:PatientIdList"
String VAUEXPATAH = "v4:value"
String PATIDXPATH = "v4:patientId"

	StringBuffer srchEMPI = new StringBuffer('|')
	String sMsg = context.getCurrentStep().getName() + ' - '
	def srcData = testRunner.testCase.getPropertyValue('srcData' )
	def dtaProp = testRunner.testCase.getTestStepByName(srcData)
/*
	def holder = new com.eviware.soapui.support.GroovyUtils( context ).getXmlHolder( dtaProp.getPropertyValue('Request'))
*/
	def request = context.expand( '${getPersonsTmplt#Request}' )
	def holder = new com.eviware.soapui.support.GroovyUtils( context ).getXmlHolder( request)
	def contextCode = testRunner.testCase.getPropertyValue('contextCode' )
	def contextNode = holder.getDomNode( CONTEXTXPATH )
	def pnts = holder.getDomNode( PATIDLISTXPATH )
//	log.info sMsg + 'pnts: ' + pnts
//log.info 'Before: ' + holder.getXml()
//log.info 'Context: ' + contextNode.getClass().getName()
//log.info 'Context: ' + contextNode
//log.info 'Context: ' + contextNode.hasChildNodes()
	if (contextNode.hasChildNodes()){
		log.info 'contextNode has a child'
	} else {
		def od = contextNode.getOwnerDocument()
//log.info 'od: ' + od.getClass().getName()
		def v = od.createTextNode( VAUEXPATAH )
//log.info 'v: ' + v
		contextNode.appendChild(v)
		log.info 'contextNode child created'
	}
	contextNode.getFirstChild().setNodeValue(contextCode)
log.info 'Context: ' + contextNode.getFirstChild().getNodeValue()

	def n
//	log.info 'pnts: ' + pnts
	log.info 'has children: ' + pnts.hasChildren()
	def thisNode = pnts.getFirstChild()
	// remove all patientId nodes (specifically from recently processed multi-empi request)
	while (thisNode != null) {
//		log.info thisNode.getNodeType() + ' ' + thisNode.getNodeName() + ' ' + thisNode.getNodeValue()
		if (thisNode.getNodeName().equals( PATIDXPATH )) {
			n = thisNode.cloneNode(true)
			def oldChild = thisNode
			thisNode = thisNode.getNextSibling()
			pnts.removeChild(oldChild)
		} else {
			thisNode = thisNode.getNextSibling()
		}
	}
//	log.info 'n: ' + n
	if (n == null) {	// if no patientid nodes then create a new one
//		n = pnts.getOwnerDocument().createElement('pat:patientId')
//		n = pnts.getOwnerDocument().createElementNS('pat', 'patientId')
//		n = pnts.getOwnerDocument().createElement('patientId')
		n = pnts.createElement('patientId')
//		def t = pnts.getOwnerDocument().createTextNode('')
		def t = pnts.createTextNode('')
		n.appendChild(t)
	}
	// add list of empi's to search request
	String[] empis = empiList.split(',')
	def empiCnt = 0
//log.info empis.size() + ' - ' + empis[0].length()
	for(idx = 0; idx < empis.size(); idx++) {
		//log.info idx + ' - ' + empis[idx]
		if (verifyEmpi(empis[idx]).length() > 0) {
			n.getFirstChild().setNodeValue(empis[idx])
			pnts.appendChild(n)
			srchEMPI = srchEMPI.append(verifyEmpi(empis[idx])).append('|')
			n = n.cloneNode(true)	// clone for use with next empi
			empiCnt++
		}
	}
	// update request with new document
//log.info 'After: ' + holder.getXml()
	dtaProp.setPropertyValue('Request', holder.getXml())
	testRunner.testCase.setPropertyValue('srchEMPI', srchEMPI.toString())
	log.info 'srchEMPI: ' + empiCnt + ' Empis: ' + srchEMPI.toString()
}

String verifyEmpi(empi) {
	try {
		return new Long(empi).toString()
	} catch (NumberFormatException e) {
		log.warn 'Invalid EMPI Value: ' + e.getMessage()
		return ''
	}
}

