String getRequestEmpi(pnts) {
	def Empi = ''
	def thisNode = pnts.getFirstChild()
	while (thisNode != null) {
//	log.info thisNode.getNodeType() + ' ' + thisNode.getNodeName() + ' ' + thisNode.getNodeValue()
		if (thisNode.getNodeName().equals('v4:patientId')) {
//			log.info thisNode.getFirstChild().getNodeValue()
			Empi = Empi + thisNode.getFirstChild().getNodeValue() + ','
		}
		thisNode = thisNode.getNextSibling()
	}
	if (Empi.length() > 0) {Empi = Empi.substring(0, Empi.length()-1) } // remove trailing comma
	return Empi
}

