/*
	Enter from logGetPersons
	srcData indicates which step to get request data from
	copyCnt indicates last record copied (incremented by 1 in this routine)
	specific data structure will contain all records from which the record count is obtained

	if copyCnt >= data records then goto DataSource Loop (we're done)
	bump copy Cnt
	select copyCnt record from indicated response
	copy all data to PersonProperties
	store copy Cnt
*/
String sMsg = context.getCurrentStep().getName() + ' - '
def rspns
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )

Hashtable hdd = new Hashtable()

// determine source (searchPerson or getPersonSearchResults)

def dtaStep = testRunner.testCase.getTestStepByName(testRunner.testCase.getPropertyValue('srcData'))
rspns = dtaStep.getPropertyValue('Response')
if (rspns == null) {
	logWarn sMsg + 'rspns is Null'
	testRunner.gotoStepByName('validateData')
}
//log.info sMsg - 'rspns: ' + rspns
def holder = groovyUtils.getXmlHolder( rspns)

//log.info holder.getXml()
def propStep = testRunner.testCase.getTestStepByName('PersonProperties')

// Bump copy count to next record to copy
Integer copyCnt = new Integer(testRunner.testCase.getPropertyValue('copyCnt' ))

def pnts = holder.getDomNodes('//ns1:Patient' )
log.info sMsg + 'copyCnt: ' + copyCnt.toString() + ' pntSize:' + pnts.size()
//log.info 'pnts.Size: ' +  pnts.size()

// see if there is a copyCnt patient to process?
if (pnts.size() <= 0) {
	// No records to process in this batch
	testRunner.gotoStepByName('DataSource Loop')
} else if (copyCnt >= pnts.size()) {
	// gathered all records in this batch, are ther more to retrieve?
	testRunner.gotoStepByName('DataSource Loop')
} else {
	def contextCode = testRunner.testCase.getPropertyValue('contextCode' )
	createHDDMap( hdd )
	log.info sMsg + 'code: ' + contextCode
	if (!hdd.containsKey(contextCode)) {
		logWarn (sMsg + 'Invalid Context Code - ' + contextCode)
		contextCode = 'Invalid'
//		testRunner.fail ('Unsupported Context Code: ' + contextCode + '')
	}// else {
	// get this record
	copyCnt++
	String cnt = copyCnt.toString()
	def rspnsPreAmble = testRunner.testCase.getPropertyValue('rspnsPreAmble' )
	def rspnsPostAmble = testRunner.testCase.getPropertyValue('rspnsPostAmble' )
	def wtSrch = testRunner.testCase.getPropertyValue('wtSrch' )
	String ptAccess = rspnsPreAmble + cnt + rspnsPostAmble
	String wtAccess = rspnsPreAmble + cnt + wtSrch
//	log.info 'cnt: ' + cnt
//		propStep.clearPropertyValues()	// Initialize all properties - moved to logResponse step 110727

		// Move record[copyCnt] to dataSink
		captureWarnings(hdd.get(contextCode), holder, propStep, cnt)
 		captureAttributions(hdd.get(contextCode), holder, propStep, ptAccess)
		capturePatientExternalId(hdd.get(contextCode), holder, propStep, ptAccess)
		capturePersonName(hdd.get(contextCode), holder, propStep, ptAccess)
		captureTelecon(hdd.get(contextCode), holder, propStep, ptAccess)
		captureReligion(hdd.get(contextCode), holder, propStep, ptAccess)
		//captureRoleStatus(hdd.get(contextCode), holder, propStep, ptAccess) Not captured?
		captureBirthDate(hdd.get(contextCode), holder, propStep, ptAccess)
		captureDeceasedIndicator(hdd.get(contextCode), holder, propStep, ptAccess)
		captureMultipleBirthOrderNumber(hdd.get(contextCode), holder, propStep, ptAccess)
		captureAdministrativeRace(hdd.get(contextCode), holder, propStep, ptAccess)
		captureAdministrativeGender(hdd.get(contextCode), holder, propStep, ptAccess)
		captureAddress(hdd.get(contextCode), holder, propStep, ptAccess)
		captureAdministrativeMaritalStatus(hdd.get(contextCode), holder, propStep, ptAccess)
		captureNationalAssignedIdentifier(hdd.get(contextCode), holder, propStep, ptAccess)
		captureLanguage(hdd.get(contextCode), holder, propStep, ptAccess)
		captureEthnicity(hdd.get(contextCode), holder, propStep, ptAccess)
		captureCadavaricDonor(hdd.get(contextCode), holder, propStep, ptAccess)
		// Notice weight requres 'wtSrch' rather than ptAccess
		captureRecordWeight(hdd.get(contextCode), holder, propStep, wtAccess)
	// Done copying. Update copyCnt
	testRunner.testCase.setPropertyValue('copyCnt', cnt)
//	}
}

void captureWarnings(cntxt, hldr, propStep, cnt) {
	def wrns = hldr.getDomNodes('//ns1:warnings[' + cnt + ']')
	if (wrns != null){
	log.info 'wrns: ' + wrns.size() + ' - ' + wrns 
		def wrnMsg = ''
		def retVal = ''
		for (def idx = 0; idx < wrns.size(); idx++) {
			def chn = wrns[idx].getChildNodes()
			for (def idy = 0; idy<chn.getLength(); idy++) {
				if (chn.item(idy).hasChildNodes()) {
					def cn = chn.item(idy).getChildNodes()
					for(idz = 0; idz < cn.getLength(); idz++) {
						if (cn.item(idz).getNodeName() == 'Type') { 
							wrnMsg = 'WARNING - '+ cn.item(idz).getFirstChild().getNodeValue()
						} else if (cn.item(idz).getNodeName() == 'Details') {
							wrnMsg = wrnMsg + ':' + cn.item(idz).getFirstChild().getNodeValue()
						}
					}
					wrnMsg = wrnMsg + '\n'
//					logWarn idy + '-' + wrnMsg
					retVal += wrnMsg
				}
			}
		}
		propStep.setPropertyValue('message', retVal.replaceAll('\n', '^'))
	}
}
