void captureAddress(cntxt, hldr, propStep, ptAccess) {
// extract person name data from a valid response & populate the Properties step
	int idx;
	String Address1
	String Address2
	String City
	String State
	String ZIp
	String County
	String Country
	String AddressType
	String AddressTypeCode
	String adrPreamble = ptAccess + '/ns1:address[';
	String addr1Part = "]/ns1:addressLine1[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String addr2Part = "]/ns1:addressLine2[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String cityPart = "]/ns1:city[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String statePart = "]/ns1:state[1]/ns1:data[1]/ns1:CWE[1]/ns1:originalText[1]/ns1:value[1]";
	String countryPart = "]/ns1:country[1]/ns1:data[1]/ns1:CWE[1]/ns1:originalText[1]/ns1:value[1]";
	String countyPart = "]/ns1:county[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String zipPart = "]/ns1:postalCode[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String addrUsePart = "]/ns1:addressUse[1]/ns1:data[1]/ns1:CWE[1]/ns1:originalText[1]/ns1:value[1]";
	String addrUseCdPart = "]/ns1:addressUse[1]/ns1:data[1]/ns1:CWE[1]/ns1:code[1]/ns1:value[1]";
	String sMsg = 'Address - '
	String addrHome = 'addrHome'
	String addrWork = 'addrWork'

	def myCnt = hldr.getDomNodes(ptAccess + '/ns1:address').size()

	for ( idx = 1 ; idx <= myCnt ; idx++ ) {
		Address1 = hldr.getNodeValue( adrPreamble + idx + addr1Part);
		Address2 = hldr.getNodeValue( adrPreamble + idx + addr2Part)
		City = hldr.getNodeValue( adrPreamble + idx + cityPart)
		State = hldr.getNodeValue( adrPreamble + idx + statePart)
		ZIp = hldr.getNodeValue( adrPreamble + idx + zipPart)
		County = hldr.getNodeValue( adrPreamble + idx + countyPart)
		Country = hldr.getNodeValue( adrPreamble + idx + countryPart)
		AddressType = hldr.getNodeValue( adrPreamble + idx + addrUsePart)
		AddressTypeCode = hldr.getNodeValue( adrPreamble + idx + addrUseCdPart)
log.info sMsg + idx + ' ' + Address1 + ' ' + Address2 + ' ' + City + ' ' + State + ' ' + ZIp + ' ' + 
		County + ' ' + Country + ' ' + AddressType + ' ' + AddressTypeCode
//		if( AddressType.equals("Home") || AddressType.equals("199") ) {
		if( AddressType.equals(cntxt.get(addrHome) )) {
			propStep.setPropertyValue("Address1", Address1)
			propStep.setPropertyValue("Address2", Address2)
			propStep.setPropertyValue("City", City)
			propStep.setPropertyValue("State", State)
			propStep.setPropertyValue("ZIp", ZIp)
			propStep.setPropertyValue("County", County)
			propStep.setPropertyValue("Country", Country)
			propStep.setPropertyValue("Address_Type", AddressType )
			propStep.setPropertyValue("Address_TypeCode", AddressTypeCode )
//		} else if (AddressType.equals("Work") || AddressType.equals("200") ) {
		} else if (AddressType.equals(cntxt.get(addrWork)) || AddressType.equals("200") ) {
			propStep.setPropertyValue("WK_Address1", Address1 )
			propStep.setPropertyValue("WK_Address2", Address2 )
			propStep.setPropertyValue("WK_City", City )
			propStep.setPropertyValue("WK_State", State )
			propStep.setPropertyValue("WK_Zip", ZIp )
			propStep.setPropertyValue("WK_County", County )
			propStep.setPropertyValue("WK_Country", Country )
			propStep.setPropertyValue("WK_Type", AddressType )
			propStep.setPropertyValue("WKAddrTypeCode", AddressTypeCode)
		} else if(AddressType != null) {
			logWarn sMsg + 'Undefined Address Type: ' + AddressType + ' (' + AddressTypeCode + ')'
			log.warn 'addrHome: ' + cntxt.get(addrHome) + ' addrWork: ' + cntxt.get(addrWork)
		}
	}
}
