	f = c.getSelectedFile();
	try {	// store searchCriteria File Name in data source
		def srchStep = testRunner.testCase.getTestStepByName('srchCriteria')
		nm = f.getCanonicalPath()
//log.info 'step: ' + srchStep.getClass().getName()
		srchStep.getDataSource().setFileName(nm)
		// see if context is part of search criteria file name
		idx = nm.lastIndexOf('_')
		if (idx >= 0) {
			def sTmp = nm.substring(idx+1)
			idx = sTmp.indexOf('.')    // remove file extension
			if (idx >= 0) sTmp = sTmp.substring(0,idx)
			Integer cntxt
			try {
				cntxt = new Long(sTmp)
			} catch (NumberFormatException e) {
				cntxt = -1
			}
			if (cntxt > 0 & cntxt < Integer.MAX_VALUE) {
				// set context to sTmp
				testRunner.testCase.setPropertyValue('contextCode', sTmp)
			}
		}
//log.info 'contextCode: ' + testRunner.testCase.getPropertyValue('contextCode' )

		// Calculate current time stamp for duration of run
		TimeStamp = new SimpleDateFormat('yyyyMMddHHmmss').format(Calendar.getInstance().getTime())
		testRunner.testCase.setPropertyValue('TimeStamp', TimeStamp)
		// Create output template from search criteria name & timestamp
		outputTmplt = f.getName()
//log.info 'nm: ' + outputTmplt
		idx = outputTmplt.lastIndexOf('.');
		if (idx > 0) {
			outputTmplt = outputTmplt.substring(0,idx).concat('_').concat(TimeStamp)
			testRunner.testCase.setPropertyValue('outputTmplt', outputDir.concat('\\').concat(outputTmplt))
//log.info 'tmplt: ' + testRunner.testCase.getPropertyValue('outputTmplt')
			// Initialize search count
			testRunner.testCase.setPropertyValue('searchCnt', '0')
		}else {
			testRunner.fail 'Test Case Setup - Unable to format Output file template'
		}
	} catch (IOException e) {	// catch any exceptions as a test case failure
		nm = 'Test Case Setup - Error: ' + e.getMessage()
		testRunner.fail nm
	}
} else {	// no search criteria file. Fail test case
	nm = 'No Input DataSource File Selected '
	testRunner.fail nm
}
