void clearData(gStep) {
	def idx
	for( idx=2; idx < gStep.getPropertyCount(); idx++) {
		gStep.setPropertyValue(gStep.getPropertyAt(idx).getName(), '')
	}
}
	String getWarnings(wrns) {
		def wrnMsg = ''
	//log.info 'wrns.size() ' + wrns.size()
		for (def idx = 0; idx < wrns.size();idx++) {
			def chn = wrns[idx].getChildNodes()
	//log.info 'chn.getLength() ' + chn.getLength()
			for (def idy = 0; idy<chn.getLength(); idy++) {
				if (chn.item(idy).hasChildNodes()) {
					def cn = chn.item(idy).getChildNodes()
					wrnMsg = cn.item(0).getFirstChild().getNodeValue() + ':' + 
							cn.item(1).getFirstChild().getNodeValue() + ';'
					logWarn idy + '-' + wrnMsg
				}
			}
		}
	//	log.info 'getWarnings: ' + wrnMsg
		return wrnMsg
	}
