void capturePatientExternalId(cntxt, hldr, propStep, ptAccess) { // empi,.mrn's, radid's
// extract ID data from a valid response & populate the Properties step
	int idx;
	String idNumber;
	String idFacId;
	String idFacCode;
	String idType;
	String idPreamble = ptAccess + '/ns1:patientExternalId[';
	String idValuePart = ']/ns1:data[1]/ns1:II[1]/ns1:extension[1]/ns1:value';
	String idFacIdPart = ']/ns1:assigningAuthority[1]/ns1:data[1]/ns1:CWE[1]/ns1:originalText[1]/ns1:value';
	String idFacCodePart = ']/ns1:assigningAuthority[1]/ns1:data[1]/ns1:CWE[1]/ns1:code[1]/ns1:value';
	String idTypePart = ']/ns1:externalIdType[1]/ns1:data[1]/ns1:CNE[1]/ns1:originalText[1]/ns1:value';
//	String dataPart = "[1]/ns1:value[1]";
	String sMsg = 'PatientExternalId - '

	def myCnt = hldr.getDomNodes(ptAccess + '/ns1:patientExternalId').size()
	for ( idx = 1 ; idx <= myCnt ; idx++ ) {
		idNumber = hldr.getNodeValue( idPreamble + idx + idValuePart);
		idFacId = hldr.getNodeValue( idPreamble + idx + idFacIdPart);
		idFacCode = hldr.getNodeValue( idPreamble + idx + idFacCodePart);
		idType = hldr.getNodeValue( idPreamble + idx + idTypePart)
log.info sMsg + "id: " + idx + ' ' + idNumber + ' ' + idFacId + ' ' + idFacCode + ' ' + idType

		if( idType.equals("EMPI") ) {
			propStep.setPropertyValue("EMPI" , idNumber);
/*
			def srchEMPI = testRunner.testCase.getPropertyValue('srchEMPI' )
			if (srchEMPI.length() > 0) {
				if (srchEMPI.indexOf('|' + idNumber + '|') < 0) {
					logWarn 'Empi ' + idNumber + ' not found in search list ' + srchEMPI
				}
			}
*/
		} else if (idType.equals("RADID") ) {
			addProperty(propStep, idNumber, "radID")
//			propStep.setPropertyValue("radID" , idNumber);
			addProperty(propStep, idFacCode, "Rad_Fac_Code")
			addProperty(propStep, idFacId, "radFacDesc")
//			propStep.setPropertyValue("radFacDesc" , idFacId);
		} else if (idType.equals("MRN") ) {
			addProperty(propStep, idNumber, "MRN")
//			propStep.setPropertyValue("MRN" , idNumber);
			addProperty(propStep, idFacCode, "MRN_Fac_Code")
			addProperty(propStep, idFacId, "mrnFacDesc")
//			propStep.setPropertyValue("mrnFacDesc" , idFacId);
		} else if (idType != null ) {
			logWarn sMsg + 'Undefined idType: ' + idType + ' (' + idNumber + ')'
		} else if (idFacId != null) {
			addProperty(propStep, idFacCode, "Fac_Code" )
			addProperty(propStep, idFacId, "Fac_Desc" )
		}
	}
}
void capturePersonName(cntxt, hldr, propStep, ptAccess) { // all types
// extract person name data from a valid response & populate the Properties step
	int idx;
	String familyName;
	String givenName;
	String middleName;
	String suffixName;
	String titleName;
	String personNameUse;
	String personNameUseCd;
	String pntPreamble = ptAccess + '/ns1:personName[';
	String fmlyNamePart = "]/ns1:familyName";
	String gvnNamePart = "]/ns1:givenName";
	String midNamePart = "]/ns1:middleName";
	String sfxNamePart = "]/ns1:suffixName";
	String ttlNamePart = "]/ns1:titleName";
	String dataPart = "[1]/ns1:data[1]/ns1:ST[1]/ns1:value[1]";
	String prsnUsePart = "]/ns1:personNameUse[1]/ns1:data[1]/ns1:CWE[1]/ns1:originalText/ns1:value[1]";
	String prsnUseCdPart = "]/ns1:personNameUse[1]/ns1:data[1]/ns1:CWE[1]/ns1:code/ns1:value[1]";
	String sMsg = 'PersonName - '
	String namCur = 'namCur'
	String namMdn = 'namMdn'
	String namPref = 'namPref'
	String namAlias = 'namAlias'

	def myCnt = hldr.getDomNodes(ptAccess + '/ns1:personName').size()

	for ( idx = 1 ; idx <= myCnt ; idx++ ) {
		middleName = hldr.getNodeValue( pntPreamble + idx + midNamePart + dataPart);
		suffixName = hldr.getNodeValue( pntPreamble + idx + sfxNamePart + dataPart);
		titleName = hldr.getNodeValue( pntPreamble + idx + ttlNamePart + dataPart)
		familyName = hldr.getNodeValue( pntPreamble + idx + fmlyNamePart + dataPart)
		givenName = hldr.getNodeValue( pntPreamble + idx + gvnNamePart + dataPart)
		personNameUse = hldr.getNodeValue( pntPreamble + idx + prsnUsePart )
		personNameUseCd = hldr.getNodeValue( pntPreamble + idx + prsnUseCdPart )
log.info sMsg + "name: " + idx + ' ' + familyName + ' ' + givenName + ' ' + middleName + ' ' + 
	suffixName + ' ' + titleName + ' ' + personNameUse + ' ' + personNameUseCd
		if( personNameUse.equals(cntxt.get(namCur)) ) {
			propStep.setPropertyValue("lastName" , familyName);
			propStep.setPropertyValue("firstName" , givenName);
			propStep.setPropertyValue("middleName" , middleName);
			propStep.setPropertyValue("Name_Suffix" , suffixName);
			propStep.setPropertyValue("Name_Title" , titleName);
			propStep.setPropertyValue("PTNameType" , personNameUse);
			propStep.setPropertyValue("PTNameTypeCd" , personNameUseCd);
		} else if (personNameUse.equals(cntxt.get(namMdn)) ) {
			propStep.setPropertyValue("maidenLast" , familyName);
			propStep.setPropertyValue("maidenFirst" , givenName);
			propStep.setPropertyValue("maidenMiddle" , middleName);
			propStep.setPropertyValue("maidensuffix" , suffixName);
			propStep.setPropertyValue("maidentitle" , titleName);
			propStep.setPropertyValue("maidenNameType" , personNameUse);
			propStep.setPropertyValue("maidenNameTypeCd" , personNameUseCd);
		} else if (personNameUse.equals(cntxt.get(namPref)) ) {
			propStep.setPropertyValue("prefLast" , familyName);
			propStep.setPropertyValue("prefFirst" , givenName);
			propStep.setPropertyValue("prefMiddle" , middleName);
			propStep.setPropertyValue("prefsuffix" , suffixName);
			propStep.setPropertyValue("preftitle" , titleName);
			propStep.setPropertyValue("prefNameType" , personNameUse);
			propStep.setPropertyValue("prefNameTypeCd" , personNameUseCd);
		} else if (personNameUse.equals(cntxt.get(namAlias)) ) {
			propStep.setPropertyValue("aliasLast" , familyName);
			propStep.setPropertyValue("aliasFirst" , givenName);
			propStep.setPropertyValue("aliasMiddle" , middleName);
			propStep.setPropertyValue("aliassuffix" , suffixName);
			propStep.setPropertyValue("aliastitle" , titleName);
			propStep.setPropertyValue("aliasNameType" , personNameUse);
			propStep.setPropertyValue("aliasNameTypeCd" , personNameUseCd);
		} else if(personNameUseCd != null) {
			logWarn sMsg + 'Undefined Name Type: ' + personNameUse + ' (' + personNameUseCd + ')'
			log.info 'Current: ' + cntxt.get(namCur) + ' Maiden: ' + cntxt.get(namMdn) + ' Preferred: ' +
				cntxt.get(namPref) + ' Alias: ' + cntxt.get(namAlias)
		}
	}
}
