void addProperty(propStep, val, prop) {
// append this value to current valurs for this property
	String p = propStep.getPropertyValue(prop)
	if (val == null) val = ''
//	log.info 'prop: ' + prop + ' p: ' + p + ' newVal: ' + val
	if (p != null) {
		p = p.concat(';').concat(val)
	} else {
		p = val
	}
	propStep.setPropertyValue(prop, p);
}

